import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './../Navbar.css';
import axios from 'axios';


export default class Navbar extends Component {

  eventoLogOut=()=>{
    localStorage.clear();
  }

  render() {
    return (
      <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
        <Link to="/" className="navbar-brand">Consultorio Medico</Link>
        <div className="collpase navbar-collapse">
        <ul className="navbar-nav mr-auto">
          <li className="navbar-item">
          <Link to="/turnosPaciente" className="nav-link">Turnos</Link>
          </li>
          <li className="navbar-item">
          <Link to="/recetasPaciente" className="nav-link">Recetas</Link>
          </li>
          <li className="navbar-item">
          <Link to="/historialPaciente" className="nav-link">Historiales</Link>
          </li>
          <li className="navbar-item">
          <Link to="/" className="nav-link" onClick={this.eventoLogOut}>Salir</Link>
          </li>
        </ul>
        </div>
      </nav>
    );
  }
}
